    .container {
      width: 100dvw;
      height: 100dvh;
      position: relative;
      overflow: hidden;
      display: flex;
      justify-content: space-around
    }

    .title {
      max-height: 55dvh
    }

    .button {
      cursor: pointer;
      animation: btnAnim 1s ease-in-out infinite alternate;
      transition: opacity .3s;
      max-height: 30dvh
    }

    .button.hide {
      opacity: 0;
      pointer-events: none
    }

    #btnSecond {
      display: none
    }

    .part {
      width: 40%;
      display: flex;
      flex-direction: column;
      align-items: center;
      justify-content: center;
      gap: 3dvh;
      padding: 5px
    }

    .part svg {
      width: 100%;
      max-height: 100%
    }

    .spinner {
      position: relative;
      width: 100%
    }

    .cup {
      position: absolute;
      z-index: -1;
      width: 7dvw
    }

    .cup1 {
      left: -5dvw;
      top: 10dvh;
      width: auto;
      max-width: 10dvw;
      max-height: 15dvh;
      animation: livitation1 3s ease-in-out infinite alternate
    }

    .cup2 {
      right: -2dvw;
      bottom: 0dvh;
      animation: livitation2 4s ease-in-out infinite alternate
    }

    .cup3 {
      left: 0dvw;
      bottom: 5dvh;
      animation: livitation3 2s ease-in-out infinite alternate
    }

    .cup4 {
      left: -7dvw;
      top: 50dvh;
      animation: livitation4 3s ease-in-out infinite alternate
    }

    .cup5 {
      right: -5dvw;
      top: 5dvh;
      animation: livitation5 5s ease-in-out infinite alternate
    }

    @keyframes livitation1 {
      to {
        transform: translate(25%, 25%)
      }
    }

    @keyframes livitation2 {
      to {
        transform: translate(-25%, -65%)
      }
    }

    @keyframes livitation3 {
      to {
        transform: translate(25%, 35%)
      }
    }

    @keyframes livitation4 {
      to {
        transform: translate(22%, -45%)
      }
    }

    @keyframes livitation5 {
      to {
        transform: translate(-25%, 65%)
      }
    }

    #spinner {
      transform-origin: center
    }

    .spin {
      animation: spinWheel 6s ease-in-out forwards
    }

    @keyframes spinWheel {
      0% {
        transform: rotate(0)
      }

      70% {
        transform: rotate(2808deg)
      }

      to {
        transform: rotate(2790deg)
      }
    }

    .winn {
      position: absolute;
      z-index: 55;
      width: 100dvw;
      height: 100dvh;
      opacity: 0;
      pointer-events: none;
      transition: opacity .3s
    }

    .winn__box {
      width: 100dvw;
      height: 100dvh;
      top: 0;
      left: 0;
      position: relative;
      background-color: #000000a6
    }

    .winnItem {
      width: 30dvw;
      position: absolute;
      left: 50%;
      top: 50%;
      transform: translate(-50%, -50%) scale(.2);
      transition: transform .3s, opacity .3s
    }

    .shine {
      width: 50dvw;
      transform-origin: center;
      animation: rotate 20s linear infinite alternate
    }

    .winn.active {
      opacity: 1
    }

    .winn.active .winnItem {
      transform: translate(-50%, -50%) scale(1)
    }

    .winn.active .winnItem.hide {
      transform: translate(-50%, -50%) scale(0);
      opacity: 0
    }

    @keyframes rotate {
      to {
        transform: translate(-50%, -50%) scale(1) rotate(720deg)
      }
    }

    #lastBtn {
      max-width: 80dvw;
      max-height: 80dvh;
      position: absolute;
      left: 50%;
      top: 50%;
      transform: translate(-50%, -50%) scale(0);
      transition: transform .3s;
      cursor: pointer;
      pointer-events: none
    }

    #lastBtn.active {
      transform: translate(-50%, -50%) scale(1);
      animation: lastAnim 1s ease-in-out infinite alternate;
      pointer-events: all
    }

    @keyframes lastAnim {
      to {
        transform: translate(-50%, -50%) scale(.9)
      }
    }

    @keyframes btnAnim {
      to {
        transform: scale(.9)
      }
    }

    @media (max-aspect-ratio: 1/1) {
      #btnSecond {
        display: flex
      }

      .container {
        flex-direction: column;
        justify-content: space-around
      }

      .part {
        width: 100%;
        align-items: center;
        padding: 0
      }

      #btn {
        position: absolute;
        bottom: 10dvh;
        display: none
      }

      .winnItem {
        width: 65dvw
      }

      .shine {
        width: 100dvw
      }

      .cup1 {
        width: auto;
        height: 7dvh;
        left: 5dvw;
        top: -5dvh
      }

      .cup2 {
        right: 5dvw;
        width: auto;
        height: 10dvh;
        bottom: -5dvh
      }

      .cup3 {
        left: 4dvw;
        width: auto;
        height: 10dvh;
        bottom: -5dvh
      }

      .cup4 {
        left: 36dvw;
        top: -3dvh;
        width: auto;
        height: 10dvh
      }

      .cup5 {
        right: 5dvw;
        top: 0;
        width: auto;
        height: 8dvh
      }

      .title svg {
        max-height: 25dvh
      }

      .spinner {
        display: flex;
        justify-content: center
      }

      .spinner svg {
        max-height: 50dvh
      }

      .btn {
        display: flex;
        justify-content: center
      }

      #btnSecond {
        margin-bottom: 60px
      }

      #btnSecond svg {
        max-width: 75dvw;
        height: auto
      }
    }

    .text {
      position: absolute;
      width: 100dvw;
      bottom: 1dvh;
      color: #ccc;
      display: flex;
      justify-content: center;
      text-align: center;
      font-size: 12px;
      z-index: -1
    }

    @media (max-width: 255px) {
      .text {
        font-size: 8px
      }
    }
  </style>
</head>

  <script>
   const btns = document.querySelectorAll(".btn");
const spinner = document.getElementById("spinner");
const winn = document.getElementById('winn')
const winnItems = document.querySelectorAll('.winnItem');
const lastBtn = document.getElementById('lastBtn');
const foneMusic = document.getElementById('fone_music')
const winnSound = document.getElementById('winnSound')
const spinnSound = document.getElementById('spinnSound')
document.addEventListener("visibilitychange", function () {
        if (document.visibilityState === "hidden") {
          foneMusic.pause();
          winnSound.pause();
          spinnSound.pause();
        } else {
          if (foneMusic.paused) {
            foneMusic.play();
          }
        }
      });
document.addEventListener('click',()=>{
  foneMusic.play()
})
btns.forEach(btn=>{
  btn.addEventListener("click", () => {
    spinnSound.play()
 btns.forEach(btn=>btn.classList.add('hide'))
    spinner.classList.add("spin");
    setTimeout(() => {
      winnSound.play()
      winn.classList.add('active')
      setTimeout(() => {
        winnItems.forEach(item=>item.classList.add('hide'))
        setTimeout(() => {
          
          lastBtn.classList.add('active')
        }, 300);
      }, 2000);
    }, 6500);
  });

})


lastBtn.addEventListener('click',()=>{

    mraid.open('https://apps.apple.com/ru/app/betboom-%D1%81%D1%82%D0%B0%D0%B2%D0%BA%D0%B8-%D0%BD%D0%B0-%D1%81%D0%BF%D0%BE%D1%80%D1%82/id1523280942');

  
})
  </script>
